import React from 'react'
import { Header } from './Header';
import './UICONTROL.css';

function UICONTROL() {

    const idAuth = document.getElementsByClassName("id-auth");

    idAuth.innerText = "ALAMBRIT O";
    return (
        <div className='interfaz-control'><Header/>
            <div className='pantalla-control'>
                <a className='titulo-control'>INTERFAZ DE CONTROL</a>
                <a className="id-auth"></a>
            </div>
        </div>

    )
}

export default UICONTROL;
